import React ,{ Component} from 'react'
import DenseTable from './components/papers'
import TitleFilterPaper from './components/filter'

const urlPapers ='https://tesisservice.azurewebsites.net/api/Papers/GetPapers';

class app extends React.Component {
  constructor(props) {
    super(props);
    this.state = {papers :[]}; 
  }

  componentDidMount() {
    fetch(urlPapers)
      .then((response) => response.json())
      .then((data) => {
        this.setState({papers : data.list}) 
      });
  }

  render(){
    return (
    <div>
      <TitleFilterPaper></TitleFilterPaper>    
    </div>
      // <DenseTable dataPapers={this.state.papers}></DenseTable>
    )

  }
}



export default app;
